                            <Text fw='bold'>{accuracyRateProps.label}</Text>
                            <Rating size='xl' {...accuracyRateProps} />
                            {accuracyRateProps.error && (
                                <Text fz={14} c='red'>
                                    Поле обязательно
                                </Text>
